import React from "react";
import ResumeItem from "./components/ResumeItem";
import { Container, Button, Row, Col } from "react-bootstrap";

const Resume = () => (
  <Container>
    <h1>Resume</h1>
    <p>Hello</p>
    <Row>
      <Col md={3}>
        <h2>Education</h2>
      </Col>
      <ResumeItem 
      title="Stanford University"
      subhead="Stanford, CA / Expected Graduation: June 2024"
      text="B.S. Product Design, B.A. Psychology, GPA: 3.8 out of 4.0.
      Organizations: Stanford Women in Design, The Stanford Daily, Stanford Culture & Emotion Lab, Stanford Open Data Project, Associated Students of Stanford University"
      />
    </Row>
  </Container>
);

export default Resume;
